import React from "react";

const dots = 8;

const getDotPosition = (index, total, radius) => {
  const angle = (index / total) * 2 * Math.PI;
  return {
    left: `${50 + radius * Math.cos(angle)}%`,
    top: `${50 + radius * Math.sin(angle)}%`,
  };
};

export default function CircleDots() {
  return (
    <div
      className="circle-dots-container"
      style={{ marginTop: "120px" }} // Adjust the value as needed
    >
      {[...Array(dots)].map((_, idx) => (
        <span
          key={idx}
          className="dot"
          style={getDotPosition(idx, dots, 38)}
        ></span>
      ))}
      <span className="dot center-dot"></span>
    </div>
  );
}
